import React, { Component } from "react";
import { withStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";

const styles = {};

class Post extends Component {
  render() {
    return (
      <Paper>
        <div>Post</div>
      </Paper>
    );
  }
}

export default withStyles(styles)(Post);
